<button type="button" class="btn btn-primary" data-bs-toggle="modal" data-bs-target="#search_popup">
  Launch demo modal
</button>


<div class="modal fade" id="search_popup" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
  <div class="modal-dialog">
    <div class="modal-content">
      <div class="modal-body">
      <div className='main-banner'>
          <div className='container-fluid'>
            <div className='banner-form'>
            <h4>Sign Up</h4>
            <form>
                    <div className='row'>
                        <div className='col-md-6  ps-0'>
                            <input placeholder='First Name *' type='text' />
                        </div>
                        <div className='col-md-6 pe-0'>
                            <input placeholder='Last Name *' type='text' />
                        </div>
                        <input placeholder='Email *' type='text' />
                        <input placeholder='Phone number *' type='text' />
                        <input placeholder='Subject *' type='text' />
                        <textarea placeholder='How may we help you? *'></textarea>
                        <p>Describe your marine situation and someone from our team
                            will be in touch within 24 hours.</p>
                        <button type='submit'>Send message</button>
                    </div>
                </form>

                <a className='google-log' to="/">
                    <img src="../../images/icons/google-icon.png" alt="" /> 
                    Continue with Google
                </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  </div>
</div>
    </div>
  )
}

export default SignUpPopup
